DELETE      sectoresprod
      WHERE cclacontrato = 0 AND ccodcontrato >= 159;
COMMIT ;

DECLARE
   CURSOR c_prod
   IS
      SELECT sproduc, cramo, cmodali, ctipseg, ccolect
        FROM v_productos
       WHERE cactivo = 1 AND cramo = 801;

   CURSOR c_contrat
   IS
      SELECT ccodcontrato, cclacontrato, LOWER (tdescripcion) tdescripcion
        FROM detclasecontrato
       WHERE cidioma = 8;

   CURSOR c_sector
   IS
      SELECT csector, tdescripcion
        FROM detcodisector
       WHERE cidioma = 8;

   v_sector   NUMBER := 0;
BEGIN
   FOR i IN c_prod
   LOOP
      FOR j IN c_contrat
      LOOP
         v_sector := 0;
         DBMS_OUTPUT.put_line (   'v_sector -->'
                               || v_sector
                               || 'j.tdescripcion -->'
                               || j.tdescripcion
                              );

         IF j.tdescripcion LIKE '%construcc%'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE '%infraes%'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE '%obras%'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE '%obra%'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE '%OBRA%'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE '%obra civil  demolicion %'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE 'OBRA%'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE 'OBRA%CIVIL%'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE '%miner%'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE '%energ%'
         THEN
            v_sector := 1;
         ELSIF j.tdescripcion LIKE '%comerc%'
         THEN
            v_sector := 2;
         ELSIF j.tdescripcion LIKE '%industr%'
         THEN
            v_sector := 2;
         ELSIF j.tdescripcion LIKE '%prestac%'
         THEN
            v_sector := 4;
         ELSIF j.tdescripcion LIKE '%servicio%'
         THEN
            v_sector := 4;
         ELSIF j.tdescripcion LIKE '%suministro%'
         THEN
            v_sector := 4;
         ELSIF j.tdescripcion LIKE '%uministro%'
         THEN
            v_sector := 4;
         ELSIF j.tdescripcion LIKE '%comunic%'
         THEN
            v_sector := 4;
         ELSIF j.tdescripcion LIKE '%transp%'
         THEN
            v_sector := 4;
         ELSIF j.tdescripcion LIKE '%TRANSPOR%'
         THEN
            v_sector := 1;
            DBMS_OUTPUT.put_line (   'v_sector -->'
                                  || v_sector
                                  || 'j.tdescripcion -->'
                                  || j.tdescripcion
                                 );
         ELSIF j.tdescripcion LIKE '%TRANSPORTE%'
         THEN
            v_sector := 1;
            DBMS_OUTPUT.put_line (   'v_sector -->'
                                  || v_sector
                                  || 'j.tdescripcion -->'
                                  || j.tdescripcion
                                 );
         ELSIF j.tdescripcion LIKE 'TRANSPORTE%'
         THEN
            v_sector := 1;
            DBMS_OUTPUT.put_line (   'v_sector -->'
                                  || v_sector
                                  || 'j.tdescripcion -->'
                                  || j.tdescripcion
                                 );
         ELSIF j.tdescripcion LIKE '%financi%'
         THEN
            v_sector := 4;
         ELSE
            v_sector := 3;
         END IF;

         --dbms_output.put_line('v_sector -->'||v_sector||'j.tdescripcion -->'||j.tdescripcion);
         BEGIN
            INSERT INTO sectoresprod
                        (cempres, cramo, cmodali, ctipseg, ccolect, cactivi,
                         cgarant, csector, ccodcontrato, cclacontrato,
                         precarg, iextrap, creten, ffecini, ffecfin,
                         cgruries, cusualt, falta, cusumod, fmodifi
                        )
                 VALUES (24, i.cramo, i.cmodali, i.ctipseg, i.ccolect, 0,
                         NULL, v_sector, j.ccodcontrato, j.cclacontrato,
                         0, 0, 'N', f_sysdate, NULL,
                         NULL, NULL, NULL, NULL, NULL
                        );
         EXCEPTION
            WHEN DUP_VAL_ON_INDEX
            THEN
               DBMS_OUTPUT.put_line (   'v_sector -excep->'
                                     || v_sector
                                     || 'j.tdescripcion -->'
                                     || j.tdescripcion
                                    );
         END;
      END LOOP;
   END LOOP;

   COMMIT;
END;
