   v_cempres     NUMBER := 24;

   CURSOR c_con
   IS
      SELECT *
        FROM sgt_subtabs_det
       WHERE csubtabla = v_csubtabla AND ccla1 = 80001;

   CURSOR c_prod
   IS
      SELECT sproduc
        FROM productos
       WHERE cramo = 801 AND cactivo = 1 AND sproduc <> 80001;
--750117_RELATI_RIESGO
BEGIN
   BEGIN
      INSERT INTO sgt_subtabs
                  (cempres, csubtabla, falta, fbaja, cusualt
                  )
           VALUES (v_cempres, v_csubtabla, f_sysdate, NULL, f_user
                  );
   EXCEPTION
      WHEN DUP_VAL_ON_INDEX
      THEN
         NULL;
   END;

   BEGIN
      INSERT INTO sgt_subtabs_ver
                  (cempres, csubtabla, fefecto, cversubt, falta, cusualt
                  )
           VALUES (v_cempres, v_csubtabla, f_sysdate, 1, f_sysdate, f_user
                  );
   EXCEPTION
      WHEN DUP_VAL_ON_INDEX
      THEN
         NULL;
   END;

   BEGIN
      INSERT INTO sgt_subtabs_des
                  (cempres, csubtabla, cidioma, tsubtabla,
