DECLARE
   v_sproduc   NUMBER;

   CURSOR c_prod
   IS
      SELECT a.sproduc, b.cgarant
        FROM v_productos a, garanpro b
       WHERE a.sproduc = b.sproduc
         AND a.cramo = b.cramo
         AND a.cmodali = b.cmodali
         AND a.ccolect = b.ccolect
         AND a.ctipseg = b.ctipseg
         AND a.cramo = 801
         AND cactivi = 0
         AND a.cactivo = 1;

   CURSOR c_acti
   IS
      SELECT cactivi
        FROM activiprod
       WHERE sproduc = v_sproduc;
BEGIN
   FOR i IN c_prod
   LOOP
      v_sproduc := i.sproduc;

      FOR j IN c_acti
      LOOP
         BEGIN
            INSERT INTO detgaranformula
                        (sproduc, cactivi, cgarant, ccampo, cconcep,
                         norden, clave, clave2, falta, cusualt
                        )
                 VALUES (v_sproduc, j.cactivi, i.cgarant, 'TASA', 'TASAREF',
                         7, 750117, NULL, f_sysdate, f_user
                        );
         EXCEPTION
            WHEN DUP_VAL_ON_INDEX
            THEN
               NULL;
         END;
      END LOOP;
   END LOOP;

   COMMIT;
END;
